import React from "react";
import PetitionForm from "../components/petitionForm";

const ComplaintRegistration = () => {
  return (
    <div>
      <h1 className="text-2xl font-bold mb-4">Complaint Registration</h1>
      <PetitionForm />
    </div>
  );
};

export default ComplaintRegistration;
